/* Hover Menus */
$(function () {
    if ($('body').hasClass('hoverMenus')) {
        $('.navbar .dropdown').hover(function () {
            $(this).find('.dropdown-menu').first().stop(true, true).slideDown(0);
        }, function () {
            var na = $(this)
            na.find('.dropdown-menu').first().stop(true, true).slideUp(0)
        });
        $('.navbar .dropdown > a').click(function () {
            window.location.href = $(this).attr('href');
        });
    }
});


/* Custom */
$(function () {
    // jQuery UItoTop
    $().UItoTop({ easingType: 'easeOutQuart' });

    // BREADCRUMB
    $('.breadcrumb > .active > a').contents().unwrap();
    $('.breadcrumb').addClass('hidden-xs');

    // PAGINATION
    $('#pagination ul').removeClass('pager').addClass('pagination');

    // ALERTS
    $('.alert').alert();

    // FORMS
    $('form').validationEngine({
        promptPosition: 'centerRight'
    });

    // CAROUSELS
    $('#caroufredsel-testimonials-container').carouFredSel({
        responsive: true,
        scroll: 1,
        circular: false,
        infinite: false,
        items: {
            visible: {
                min: 1,
                max: 1
            }
        },
        prev: '#testimonials-prev',
        next: '#testimonials-next',
        auto: {
            play: false
        }
    });

    $('#caroufredsel-clients-container').carouFredSel({
        responsive: true,
        scroll: 1,
        circular: false,
        infinite: false,
        items: {
            visible: {
                min: 1,
                max: 4
            }
        },
        prev: '#client-prev',
        next: '#client-next',
        auto: {
            play: false
        }
    });
});